import TableBody from "./table-body.component";
import TableHeader from "./table-header.component";

const Table = props => {
  return (
    <>
      <table className="table">
        <TableHeader headers={props.column} />
        <TableBody data={props.data} />
      </table>
    </>
  );
};

export default Table;
